    af: "❌ Onversoenbaar. Jammer. U is welkom om 'n ander blaaier of rekenaar te probeer, of wat ook al versoenbaar is. Andersins moet u hierdie studie terugstuur na Prolific.com.",
    ml: "❌ പൊരുത്തപ്പെടുന്നില്ല. ക്ഷമിക്കണം. മറ്റൊരു ബ്ര browser സർ, അല്ലെങ്കിൽ കമ്പ്യൂട്ടർ, അല്ലെങ്കിൽ അനുയോജ്യമായ രീതിയിൽ പരീക്ഷിക്കാൻ സ്വാഗതം. അല്ലെങ്കിൽ ദയവായി ഈ പഠനം പ്രോലോസിക്.കോമിലേക്ക് തിരികെ നൽകുക.",
    tl: "❌ hindi katugma. Pasensya na. Malugod kang subukan na subukan ang isa pang browser, o computer, o kung ano ang maaaring magkatugma. Kung hindi man mangyaring ibalik ang pag -aaral na ito sa prolific.com.",
