    fi: "❌ yhteensopimattomia. Anteeksi. Olet tervetullut kokeilemaan toista selainta tai tietokonetta tai mikä tahansa voi olla yhteensopivaa. Muussa tapauksessa palauta tämä tutkimus osoitteeseen prolific.com.",
    fr: "❌ incompatible. Désolé. Vous êtes invités à essayer un autre navigateur, ou un ordinateur, ou tout ce qui pourrait être compatible. Sinon, veuillez retourner cette étude sur prolific.com.",
    de: "❌ inkompatibel. Entschuldigung. Sie können einen anderen Browser oder Computer oder was auch immer kompatibel sein. Andernfalls geben Sie diese Studie bitte an proPultific.com zurück.",
    el: "❌ ασυμβίβαστο. Συγνώμη. Είστε ευπρόσδεκτοι να δοκιμάσετε ένα άλλο πρόγραμμα περιήγησης ή υπολογιστή ή οτιδήποτε μπορεί να είναι συμβατό. Διαφορετικά, επιστρέψτε αυτή τη μελέτη στο Prolific.com.",
    he: "❌ לא תואם. מצטער. אתם מוזמנים לנסות דפדפן אחר, או מחשב אחר, או כל מה שעשוי להיות תואם. אחרת אנא החזיר מחקר זה ל- prolific.com.",
    hi: "❌ असंगत। क्षमा मांगना। आप एक और ब्राउज़र, या कंप्यूटर, या जो कुछ भी संगत हो सकते हैं, आज़माने के लिए आपका स्वागत है। अन्यथा कृपया इस अध्ययन को prolific.com पर लौटाएं।",
    hu: "❌ összeegyeztethetetlen. Sajnálom. Szívesen kipróbálhat egy másik böngészőt, számítógépet, vagy bármi más, ami kompatibilis lehet. Ellenkező esetben kérjük, adja vissza ezt a tanulmányt a prolific.com -ra.",
    is: "❌ ósamrýmanlegt. Því miður. Þér er velkomið að prófa annan vafra, tölvu, eða hvað sem gæti verið samhæft. Annars vinsamlegast skilaðu þessari rannsókn á Prolific.com.",
    id: "❌ Tidak kompatibel. Maaf. Anda dipersilakan untuk mencoba browser lain, atau komputer, atau apa pun yang mungkin kompatibel. Kalau tidak, silakan kembalikan studi ini ke Prolific.com.",
    it: "❌ incompatibile. Scusa. Sei il benvenuto a provare un altro browser, computer o qualunque cosa possa essere compatibile. Altrimenti si prega di restituire questo studio su prolific.com.",
    ja: "of互換性がありません。ごめん。別のブラウザやコンピューター、または互換性のあるものを試すことを歓迎します。それ以外の場合は、この調査をProlific.comに返送してください。",
    kn: "ಹೊಂದಾಣಿಕೆಯಾಗುವುದಿಲ್ಲ. ಕ್ಷಮಿಸಿ. ಮತ್ತೊಂದು ಬ್ರೌಸರ್, ಅಥವಾ ಕಂಪ್ಯೂಟರ್ ಅನ್ನು ಪ್ರಯತ್ನಿಸಲು ನಿಮಗೆ ಸ್ವಾಗತವಿದೆ, ಅಥವಾ ಯಾವುದಾದರೂ ಹೊಂದಾಣಿಕೆಯಾಗಬಹುದು. ಇಲ್ಲದಿದ್ದರೆ ದಯವಿಟ್ಟು ಈ ಅಧ್ಯಯನವನ್ನು ಸಮೃದ್ಧ.ಕಾಂಗೆ ಹಿಂತಿರುಗಿ.",
    ko: "❌ 양립 할 수 없습니다. 죄송합니다. 다른 브라우저, 컴퓨터 또는 호환되는 모든 것을 시도해보십시오. 그렇지 않으면이 연구를 Prolific.com으로 반환하십시오.",
    lt: "❌ nesuderinamas. Atsiprašau. Kviečiame išbandyti kitą naršyklę ar kompiuterį ar bet ką, kas gali būti suderinama. Priešingu atveju prašome šį tyrimą grąžinti į prodicific.com.",
    ms: "❌ Tidak serasi. Maaf. Anda dialu -alukan untuk mencuba penyemak imbas, atau komputer lain, atau apa sahaja yang mungkin serasi. Jika tidak, sila kembalikan kajian ini ke Prolific.com.",
    no: "❌ Inkompatibel. Beklager. Du er velkommen til å prøve en annen nettleser, eller datamaskin, eller hva som kan være kompatibelt. Ellers returner du denne studien til Prolific.com.",
    fa: "❌ ناسازگار. متاسف. شما خوش آمدید که مرورگر یا رایانه دیگری را امتحان کنید ، یا هر آنچه ممکن است سازگار باشد. در غیر این صورت لطفاً این مطالعه را به Perfific.com برگردانید.",
    pl: "❌ Niezgodne. Przepraszam. Możesz wypróbować inną przeglądarkę, komputer lub cokolwiek, co może być kompatybilne. W przeciwnym razie zwróć to badanie na Prolific.com.",
