    tl: 'Bada. Pumunta sa Mga Setting> Tungkol sa Telepono (dating "Tungkol sa Device"). Kopyahin ang pangalan ng modelo at numero sa kaukulang mga patlang sa ibaba.',
    ar: 'بادا. انتقل إلى الإعدادات> حول الهاتف (سابقًا "حول الجهاز"). انسخ اسم النموذج والرقم إلى الحقول المقابلة أدناه.',
    hy: "Բադա Գնացեք պարամետրեր> Հեռախոսի մասին (նախկինում «սարքի մասին»): Պատճենեք մոդելի անունը եւ համարը `ստորեւ նշված համապատասխան ոլորտներին:",
    bg: "Бада. Отидете на Настройки> за телефона (преди „за устройство“). Копирайте името и номера на модела в съответните полета по -долу.",
    "zh-CN":
      "巴达。转到有关电话的设置>（以前是“关于设备”）。将型号和数字复制到下面的相应字段。",
    "zh-HK":
      "巴達。轉到有關電話的設置>（以前是“關於設備”）。將型號和數字複製到下面的相應字段。",
    hr: 'Bada. Idite na Postavke> O telefonu (ranije "O uređaju"). Kopirajte naziv i broj modela u odgovarajuća polja u nastavku.',
    cs: "Bada. Přejděte na Nastavení> O telefonu (dříve „o zařízení“). Zkopírujte název modelu a číslo do odpovídajících polí níže.",
    da: 'Bada. Gå til Indstillinger> Om telefon (tidligere "om enhed"). Kopier modelnavnet og nummeret til de tilsvarende felter nedenfor.',
    nl: 'Bada. Ga naar instellingen> over telefoon (voorheen "over apparaat"). Kopieer de modelnaam en het nummer naar de bijbehorende velden hieronder.',
    "en-UK":
      'BADA. Go to Settings > About phone (formerly "About device"). Copy the Model Name and Number to the corresponding fields below.',
    "en-US_1":
      'BADA. Go to Settings > About phone (formerly "About device"). Copy the Model Name and Number to the corresponding fields below.',
    fi: 'Bada. Siirry kohtaan Asetukset> Tietoja puhelimesta (entinen "Tietoja laitteista"). Kopioi mallin nimi ja numero alla oleviin vastaaviin kenttiin.',
    fr: 'Bada. Accédez à Paramètres> À propos du téléphone (anciennement "sur l\'appareil"). Copiez le nom et le numéro du modèle dans les champs correspondants ci-dessous.',
