    he: 'באדה. עבור אל הגדרות> אודות טלפון (לשעבר "אודות מכשיר"). העתק את שם הדגם ומספר השדות המתאימים למטה.',
    hi: 'बाडा। सेटिंग्स पर जाएं> फोन के बारे में (पूर्व में "डिवाइस के बारे में")। मॉडल नाम और संख्या को नीचे दिए गए संबंधित फ़ील्ड में कॉपी करें।',
    hu: 'Bada. Lépjen a Beállítások> A telefonról (korábban "About Eszközről"). Másolja a modell nevét és számát az alábbi megfelelő mezőkre.',
    is: "Bada. Farðu í Stillingar> Um síma (áður „um tæki“). Afritaðu nafn og númer fyrirmyndar á samsvarandi reitir hér að neðan.",
    id: 'Bada. Buka Pengaturan> Tentang Telepon (sebelumnya "Tentang Perangkat"). Salin nama model dan nomor ke bidang yang sesuai di bawah ini.',
    it: 'Bada. Vai su Impostazioni> Informazioni sul telefono (precedentemente "About Device"). Copia il nome e il numero del modello nei campi corrispondenti di seguito.',
    ja: "バダ。 [設定]> [電話について]（以前は「デバイスについて」）に移動します。モデル名と番号を以下の対応するフィールドにコピーします。",
    kn: 'ಬಡಾ. ಸೆಟ್ಟಿಂಗ್‌ಗಳು> ಫೋನ್ ಬಗ್ಗೆ (ಹಿಂದೆ "ಸಾಧನದ ಬಗ್ಗೆ") ಸೆಟ್ಟಿಂಗ್‌ಗಳಿಗೆ ಹೋಗಿ). ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಸಂಖ್ಯೆಯನ್ನು ಕೆಳಗಿನ ಅನುಗುಣವಾದ ಕ್ಷೇತ್ರಗಳಿಗೆ ನಕಲಿಸಿ.',
    ko: '바다. 설정> 전화 정보 (이전 "장치 정보")로 이동하십시오. 모델 이름과 숫자를 아래의 해당 필드에 복사하십시오.',
    lt: "Bada. Eikite į „Nustatymai“> Apie telefoną (anksčiau „Apie įrenginį“). Nukopijuokite modelio pavadinimą ir numerį į atitinkamus laukus žemiau.",
    ms: 'Bada. Pergi ke Tetapan> Mengenai Telefon (dahulunya "Mengenai Peranti"). Salin nama dan nombor model ke medan yang sepadan di bawah.',
    no: 'Bada. Gå til Innstillinger> Om telefon (tidligere "About Device"). Kopier modellnavnet og nummeret til de tilsvarende felt nedenfor.',
    fa: 'بادا به تنظیمات> درباره تلفن (که قبلاً "درباره دستگاه") بروید. نام و شماره مدل را در قسمتهای مربوطه در زیر کپی کنید.',
    pl: "Bada. Przejdź do Ustawienia> O telefonie (wcześniej „o urządzeniu”). Skopiuj nazwę modelu i numer do odpowiednich pól poniżej.",
    pt: 'Bada. Vá para Configurações> Sobre o telefone (anteriormente "Sobre o dispositivo"). Copie o nome e o número do modelo para os campos correspondentes abaixo.',
    ro: "Bada. Accesați Setări> Despre telefon (anterior „Despre dispozitiv”). Copiați numele și numărul modelului în câmpurile corespunzătoare de mai jos.",
    ru: "Бада. Перейдите в настройки> о телефоне (ранее «о устройстве»). Скопируйте имя и номер модели в соответствующие поля ниже.",
    sr: 'Бада. Идите на Подешавања> О телефону (раније "о уређају"). Копирајте име и број модела у одговарајуће поља испод.',
    es: 'Bada. Vaya a Configuración> sobre el teléfono (anteriormente "Acerca del dispositivo"). Copie el nombre y el número del modelo a los campos correspondientes a continuación.',
    su: 'Bada. Pindah ka Setélan> Ngeunaan telepon (baheulana "ngeunaan alat"). Salin nami modél sareng nomer ka widang anu aya di handap.',
    sw: 'Bada. Nenda kwa Mipangilio> Kuhusu Simu (zamani "Kuhusu Kifaa"). Nakili jina la mfano na nambari kwa uwanja unaolingana hapa chini.',
    sv: 'Bada. Gå till Inställningar> Om telefon (tidigare "About Device"). Kopiera modellnamnet och numret till motsvarande fält nedan.',
    tr: 'Bada. Telefon hakkında ayarlar> (eski adıyla "Cihaz Hakkında") gidin. Model adını ve numarasını aşağıdaki ilgili alanlara kopyalayın.',
    ur: 'بی بی اے۔ ترتیبات> فون کے بارے میں (پہلے "آلہ کے بارے میں") پر جائیں۔ ماڈل کے نام اور نمبر کو ذیل میں متعلقہ فیلڈز میں کاپی کریں۔',
