    ru: "⚠ ВНИМАНИЕ. Вы помнили:\n ‣ Максимизируйте громкость звука компьютера?\n ‣ Снять корпус телефона?\nЕсли нет, нажмите повторную регистрацию, исправьте проблему и продолжайте.",
    sr: "⚠ ОПРЕЗ. Да ли сте се сетили да:\n ‣ Максимизирајте јачину звука рачунара?\n ‣ Уклоните случај телефона?\nАко не, погодите поново запис, решите проблем и наставите.",
    es: "⚠ PRECAUCIÓN. ¿Recuerdas:\n ‣ ¿Maximizar el volumen de sonido de la computadora?\n ‣ ¿Retirar la caja del teléfono?\nSi no, presione Re-Record, solucione el problema y continúe.",
