    sw: "⚠ Tahadhari. Je! Ulikumbuka:\n ‣ Kuongeza sauti ya kompyuta?\n Ondoa kesi ya simu?\nIkiwa sio hivyo, piga rekodi ya re-record, rekebisha shida, na uendelee.",
