    tr: "⚠ Dikkat. Hatırladın mı:\n ‣ Bilgisayar ses ses seviyesini en üst düzeye çıkarır mı?\n ‣ Telefonun durumunu kaldırın mı?\nDeğilse, yeniden kaydına basın, sorunu düzeltin ve devam edin.",
    ur: "⚠ احتیاط۔ کیا آپ کو یاد ہے:\n computer کمپیوٹر کی آواز کا حجم زیادہ سے زیادہ کریں؟\n conful فون کا معاملہ ہٹا دیں؟\nاگر نہیں تو ، دوبارہ ریکارڈ کو ماریں ، مسئلہ کو ٹھیک کریں ، اور آگے بڑھیں۔",
