    hy: "📱📱📱ი📱ი 📱📱📱იifyეifyი: Պրոֆիլային գրադարանում համապատասխան խոսափողի տրամաչափումը փնտրելու համար մեզ անհրաժեշտ են ձեր հեռախոսի մոդելի անունը եւ MMM:",
    bg: "Identifyfy Your Phone. За да търсим подходящото калибриране на микрофона в библиотеката на профила, се нуждаем от името на модела на вашия телефон и MMM.",
