    kn: "ನಿಮ್ಮ ಫೋನ್ ಅನ್ನು ಗುರುತಿಸಿ. ಪ್ರೊಫೈಲ್ ಲೈಬ್ರರಿಯಲ್ಲಿ ಸೂಕ್ತವಾದ ಮೈಕ್ರೊಫೋನ್ ಮಾಪನಾಂಕ ನಿರ್ಣಯವನ್ನು ನೋಡಲು, ನಿಮ್ಮ ಫೋನ್‌ನ ಮಾದರಿ ಹೆಸರು ಮತ್ತು ಎಂಎಂಎಂ ನಮಗೆ ಅಗತ್ಯವಿದೆ.",
