    fi: '❌ Anteeksi, MMM NNN USB -mikrofoni, sarja SSS, ei ole vielä profiilikirjastossa. Hit jatka kokeilemaan toista mikrofonia. Tai paina "Palaa tarpeisiin sivulle".',
