    hi: '❌ क्षमा करें, MMM NNN USB माइक्रोफोन, सीरियल SSS, अभी तक प्रोफाइल लाइब्रेरी में नहीं है। एक और माइक्रोफोन की कोशिश करने के लिए आगे बढ़ें। या हिट "रिटर्न टू नीड्स पेज"।',
    hu: '❌ Sajnálom, az MMM NNN USB mikrofon, a soros SSS, még nem található a profilkönyvtárban. Találd meg, hogy próbálkozzon egy másik mikrofon kipróbálására. Vagy nyomja meg a "Visszatérés a szükségletek oldalát".',
    is: "❌ Því miður, MMM NNN USB hljóðneminn, Serial SSS, er ekki enn á prófílbókasafninu. Högg halda áfram til að prófa annan hljóðnema. Eða slá „Return to Needs Page“.",
    id: '❌ Maaf, mikrofon USB MMM NNN, SSS serial, belum ada di pustaka profil. Hit Lanjutkan untuk mencoba mikrofon lain. Atau tekan "Return to Needs Page".',
    it: '❌ Mi dispiace, il microfono USB MMM NNN, SSS seriale, non è ancora nella libreria del profilo. Hit procedi per provare un altro microfono. O premere "Ritorna alle esigenze della pagina".',
