  RC_angleDistanceIntro: {
    "en-US":
      "Just turn around, and we will find your viewing distance! When asked, please grant access to your camera.",
    af: "Draai net om, en ons vind u besigtigingsafstand! As u gevra word, gee u toegang tot u kamera.",
    ml: "തിരിഞ്ഞുനോക്കുക, നിങ്ങളുടെ കാഴ്ചപ്പാട് ഞങ്ങൾ കണ്ടെത്തും! ചോദിച്ചപ്പോൾ, നിങ്ങളുടെ ക്യാമറയിലേക്ക് പ്രവേശനം നൽകുക.",
    tl: "Lumiko ka lang, at makikita namin ang iyong distansya sa pagtingin! Kapag tinanong, mangyaring magbigay ng pag -access sa iyong camera.",
    ar: "فقط استدر ، وسوف نجد مسافة المشاهدة الخاصة بك! عندما سئل ، يرجى منح الوصول إلى الكاميرا.",
    hy: "Պարզապես շրջվեք, եւ մենք կգտնենք ձեր դիտման հեռավորությունը: Հարցին, խնդրում ենք մուտք ունենալ ձեր տեսախցիկ:",
    bg: "Просто се обърнете и ние ще намерим вашето разстояние за гледане! Когато попитате, моля, предоставете достъп до вашата камера.",
    "zh-CN":
      "只需转身，我们就会找到您的观看距离！当被问到时，请授予您对相机的访问权限。",
    "zh-HK":
      "只需轉身，我們就會找到您的觀看距離！當被問到時，請授予您對相機的訪問權限。",
    hr: "Samo se okrenite, a mi ćemo pronaći vašu udaljenost gledanja! Na pitanje, omogućijte pristup svom fotoaparatu.",
    cs: "Stačí se otočit a najdeme vaši sledovací vzdálenost! Na otázku, prosím, udělejte přístup k fotoaparátu.",
    da: "Bare drej rundt, så finder vi din visningsafstand! Når du bliver spurgt, skal du give adgang til dit kamera.",
    nl: "Draai je gewoon om en we zullen je kijkafstand vinden! Wanneer u wordt gevraagd, geeft u toegang tot uw camera.",
    "en-UK":
      "Just turn around, and we will find your viewing distance! When asked, please grant access to your camera.",
    "en-US_1":
      "Just turn around, and we will find your viewing distance! When asked, please grant access to your camera.",
    fi: "Käännä vain ympäri, ja löydämme katseluetäisyyden! Antakaa pääsy kameraasi.",
    fr: "Retournez-vous et nous trouverons votre distance de vision! Lorsqu'on vous a demandé, veuillez accorder l'accès à votre appareil photo.",
    de: "Drehen Sie sich einfach um und wir werden Ihre Betrachtungsentfernung finden! Wenn Sie gefragt werden, gewähren Sie bitte Zugriff auf Ihre Kamera.",
    el: "Απλά γυρίστε και θα βρείτε την απόσταση προβολής σας! Όταν ρωτήθηκε, παρακαλούμε να χορηγήσετε πρόσβαση στην κάμερά σας.",
    he: "פשוט הסתובב ונמצא את מרחק הצפייה שלך! כשנשאל, אנא הענק גישה למצלמה שלך.",
    hi: "बस चारों ओर मुड़ें, और हम आपकी देखने की दूरी पाएंगे! जब पूछा गया, तो कृपया अपने कैमरे तक पहुंच प्रदान करें।",
    hu: "Csak forduljon meg, és megtaláljuk a megtekintési távolságot! Amikor megkérdezik, kérjük, biztosítsa a hozzáférést a fényképezőgéphez.",
    is: "Snúðu bara við og við munum finna skoðunarvegalengd þína! Aðspurður, vinsamlegast gefðu aðgang að myndavélinni þinni.",
    id: "Balikkan saja, dan kami akan menemukan jarak menonton Anda! Ketika ditanya, tolong berikan akses ke kamera Anda.",
    it: "Girati e troveremo la tua distanza di visione! Alla domanda, si prega di concedere l'accesso alla fotocamera.",
    ja: "振り向くだけで、視聴距離が見つかります！尋ねられたら、カメラへのアクセスを許可してください。",
    kn: "ತಿರುಗಿ, ಮತ್ತು ನಿಮ್ಮ ವೀಕ್ಷಣೆಯ ದೂರವನ್ನು ನಾವು ಕಾಣುತ್ತೇವೆ! ಕೇಳಿದಾಗ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಕ್ಯಾಮೆರಾಗೆ ಪ್ರವೇಶವನ್ನು ನೀಡಿ.",
    ko: "그냥 돌아 서면 시청 거리를 찾을 수 있습니다! 요청하면 카메라에 액세스 할 수 있습니다.",
    lt: "Tiesiog apsisukite, ir mes rasime jūsų peržiūros atstumą! Paklausus, prašome suteikti prieigą prie jūsų fotoaparato.",
    ms: "Hanya berpaling, dan kami akan menemui jarak tontonan anda! Apabila ditanya, sila berikan akses ke kamera anda.",
    no: "Bare snu deg, så finner vi visningsavstanden din! Gi tilgang til kameraet ditt når du blir spurt.",
    fa: "فقط به دور خود بپیچید ، و فاصله مشاهده شما را پیدا خواهیم کرد! وقتی از وی سؤال شد ، لطفاً به دوربین خود دسترسی پیدا کنید.",
    pl: "Po prostu odwróć się, a znajdziemy twoją odległość oglądania! Zapytany, daj dostęp do aparatu.",
    pt: "Basta virar e encontraremos sua distância de visualização! Quando solicitado, conceda acesso à sua câmera.",
    ro: "Pur și simplu întoarceți -vă și vă vom găsi distanța de vizionare! Când ați solicitat, vă rugăm să acordați acces la camera dvs.",
    ru: "Просто развернитесь, и мы найдем ваше расстояние просмотра! Когда его спросили, пожалуйста, предоставьте доступ к вашей камере.",
    sr: "Само се окрените, а ми ћемо пронаћи вашу удаљеност гледања! На питање, молимо да дате приступ свом фотоапарату.",
    es: "¡Date la vuelta y encontraremos tu distancia de visión! Cuando se le pregunte, otorgue el acceso a su cámara.",
    su: "Ngan hélok, sareng kami bakal mendakan jarak pandangan anjeun! Nalika ditaros, punten mikeun aksés ka kaméra anjeun.",
    sw: "Pinduka tu, na tutapata umbali wako wa kutazama! Unapoulizwa, tafadhali toa ufikiaji wa kamera yako.",
    sv: "Vänd dig bara så hittar vi ditt visningsavstånd! På frågan, vänligen ge åtkomst till din kamera.",
    tr: "Sadece dönün, izleme mesafenizi bulacağız! Sorulduğunda, lütfen kameranıza erişim verin.",
    ur: "ذرا مڑیں ، اور ہم آپ کے دیکھنے کا فاصلہ تلاش کریں گے! جب ان سے پوچھا گیا تو ، براہ کرم اپنے کیمرے تک رسائی دیں۔",
  },
