    kn: "ನೀವು ಸ್ಮಾರ್ಟ್‌ಫೋನ್ ಹೊಂದಿದ್ದರೆ, ನಿಮ್ಮ ಫೋನ್ ಕ್ಯಾಮೆರಾವನ್ನು ಈ ಕೆಳಗಿನ ಕ್ಯೂಆರ್ ಕೋಡ್‌ನಲ್ಲಿ (ಕಪ್ಪು ಮತ್ತು ಬಿಳಿ ಚೆಕ್) ತೋರಿಸಿ, ಮತ್ತು ನಿಮ್ಮ ಫೋನ್‌ನ ಪರದೆಯಲ್ಲಿ ಅದರ ಮೇಲೆ ಕ್ಲಿಕ್ ಮಾಡಿ.",
    ko: "스마트 폰이있는 경우 다음 QR 코드 (흑백 체크)로 전화 카메라를 가리키고 휴대 전화 화면에서 클릭하십시오.",
