    kn: "ಅಯ್ಯೋ, 111 ಡಿಬಿಯ ಆರ್ಎಂಎಸ್ ಫಿಟ್ಟಿಂಗ್ ದೋಷವು 222 ಡಿಬಿ ಸಹಿಷ್ಣುತೆಯನ್ನು ಮೀರಿದೆ, ಆದ್ದರಿಂದ ಧ್ವನಿವರ್ಧಕವನ್ನು ಮತ್ತೆ ಮಾಪನಾಂಕ ಮಾಡಬೇಕು.",
    ko: "아아, 111 dB의 RMS 피팅 오류는 222 dB 공차를 초과하므로 라우드 스피커를 다시 보정해야합니다.",
    lt: "Deja, 111 dB RMS pritaikymo paklaida viršija 222 dB toleranciją, todėl garsiakalbis turi būti dar kartą kalibruojamas.",
    ms: "Malangnya, kesilapan RMS 111 dB melebihi toleransi 222 dB, jadi pembesar suara mesti ditentukur semula.",
    no: "Akk, RMS -passende feil på 111 dB overstiger 222 dB -toleransen, så høyttaleren må kalibreres igjen.",
