    ml: "111 സെന്റിമീറ്റർ കവിയുമ്പോൾ ഈ കീപാഡ് പ്രാപ്തമാക്കും. അതുവരെ നിങ്ങളുടെ കമ്പ്യൂട്ടറിന്റെ കീബോർഡ് ഉപയോഗിക്കുക.",
    tl: "Ang keypad na ito ay paganahin kapag ang nais na distansya ng pagtingin ay lumampas sa 111 cm. Hanggang sa pagkatapos ay gamitin ang keyboard ng iyong computer.",
    ar: "سيتم تمكين لوحة المفاتيح هذه عندما تتجاوز مسافة المشاهدة المطلوبة 111 سم. حتى ذلك الحين استخدم لوحة مفاتيح جهاز الكمبيوتر الخاص بك.",
    hy: "Այս ստեղնաշարը միացված կլինի, երբ ցանկալի դիտման հեռավորությունը գերազանցում է 111 սմը: Մինչ այդ օգտագործեք ձեր համակարգչի ստեղնաշարը:",
    bg: "Тази клавиатура ще бъде активирана, когато желаното разстояние за гледане надвишава 111 cm. Дотогава използвайте клавиатурата на вашия компютър.",
