    hr: "Ova tipkovnica bit će omogućena kada željena udaljenost gledanja prelazi 111 cm. Do tada koristite tipkovnicu računala.",
    cs: "Tato klávesnice bude povolena, když požadovaná sledovací vzdálenost přesáhne 111 cm. Do té doby použijte klávesnici počítače.",
