    el: "Αυτό το πληκτρολόγιο θα ενεργοποιηθεί όταν η επιθυμητή απόσταση προβολής υπερβαίνει τα 111 cm. Μέχρι τότε χρησιμοποιήστε το πληκτρολόγιο του υπολογιστή σας.",
    he: 'לוח מקשים זה יופעל כאשר מרחק הצפייה הרצוי עולה על 111 ס"מ. עד אז השתמש במקלדת המחשב שלך.',
