    kn: "ಅಪೇಕ್ಷಿತ ವೀಕ್ಷಣೆಯ ಅಂತರವು 111 ಸೆಂ.ಮೀ ಮೀರಿದಾಗ ಈ ಕೀಪ್ಯಾಡ್ ಅನ್ನು ಸಕ್ರಿಯಗೊಳಿಸಲಾಗುತ್ತದೆ. ಅಲ್ಲಿಯವರೆಗೆ ನಿಮ್ಮ ಕಂಪ್ಯೂಟರ್‌ನ ಕೀಬೋರ್ಡ್ ಬಳಸಿ.",
    ko: "이 키패드는 원하는 시청 거리가 111cm를 초과 할 때 활성화됩니다. 그때까지 컴퓨터의 키보드를 사용하십시오.",
    lt: "Ši klaviatūra bus įjungta, kai norimas peržiūros atstumas viršys 111 cm. Iki tol naudokite savo kompiuterio klaviatūrą.",
