    hr: "Spreman? Upotrijebite kursor za praćenje središta poprečne kose dok se meta ne pojavi. Križna kosa postaje podebljana kad je kursor na njemu.",
    cs: "Připraven? Pomocí kurzoru sledujte střed křížových vlasů, dokud se neobjeví cíl. Když je na něm kurzor, zkřížené vlasy jsou odvážné.",
    da: "Parat? Brug markøren til at spore midten af ​​krydset hår, indtil målet vises. Korshåret bliver dristigt, når markøren er på det.",
    nl: "Klaar? Gebruik de cursor om het midden van het kruishaar te volgen totdat het doelwit verschijnt. Het kruishaar wordt gewaagd wanneer de cursor erop staat.",
    "en-UK":
      "Ready? Use the cursor to track the center of the cross hair until the target appears. The cross hair becomes bold when the cursor is on it.",
    "en-US_1":
      "Ready? Use the cursor to track the center of the cross hair until the target appears. The cross hair becomes bold when the cursor is on it.",
    fi: "Valmis? Seuraa kohdistinta ristikarvojen keskustaa, kunnes kohde ilmestyy. Ristikarvat rohkeitavat, kun kohdistin on siinä.",
    fr: "Prêt? Utilisez le curseur pour suivre le centre de la transformation jusqu'à ce que la cible apparaisse. Les cheveux de la traverse deviennent audacieux lorsque le curseur est dessus.",
    de: "Bereit? Verwenden Sie den Cursor, um die Mitte des Kreuzhaars zu verfolgen, bis das Ziel erscheint. Das Kreuzhaar wird mutig, wenn der Cursor darauf ist.",
    el: "Ετοιμος? Χρησιμοποιήστε το δρομέα για να παρακολουθείτε το κέντρο των σταυροειδών μαλλιών μέχρι να εμφανιστεί ο στόχος. Τα σταυρωτά μαλλιά γίνονται τολμηρά όταν ο δρομέας είναι πάνω του.",
    he: "מוּכָן? השתמש בסמן כדי לעקוב אחר מרכז שיער הצלב עד להופעת היעד. שיער הצלב הופך להיות נועז כאשר הסמן עליו.",
    hi: "तैयार? जब तक लक्ष्य प्रकट न हो, क्रॉस बालों के केंद्र को ट्रैक करने के लिए कर्सर का उपयोग करें। जब कर्सर उस पर होता है तो क्रॉस बाल बोल्ड हो जाते हैं।",
    hu: "Kész? A kurzor segítségével nyomon kövesse a keresztszőr közepét, amíg a cél meg nem jelenik. A keresztszőr félkövérré válik, amikor a kurzor rajta van.",
    is: "Tilbúinn? Notaðu bendilinn til að fylgjast með miðju krosshársins þar til markmiðið birtist. Krosshárið verður djarft þegar bendillinn er á honum.",
    id: "Siap? Gunakan kursor untuk melacak tengah rambut silang sampai target muncul. Rambut salib menjadi berani saat kursor ada di atasnya.",
    it: "Pronto? Usa il cursore per tenere traccia del centro dei capelli incrociati fino a quando non appare il bersaglio. I capelli incrociati diventano audaci quando il cursore è su di esso.",
    ja: "準備ができて？カーソルを使用して、ターゲットが表示されるまで交差髪の中心を追跡します。カーソルが上にあると、十字髪が大胆になります。",
    kn: "ಸಿದ್ಧ? ಗುರಿ ಕಾಣಿಸಿಕೊಳ್ಳುವವರೆಗೆ ಅಡ್ಡ ಕೂದಲಿನ ಮಧ್ಯಭಾಗವನ್ನು ಪತ್ತೆಹಚ್ಚಲು ಕರ್ಸರ್ ಬಳಸಿ. ಕರ್ಸರ್ ಅದರ ಮೇಲೆ ಇದ್ದಾಗ ಅಡ್ಡ ಕೂದಲು ದಪ್ಪವಾಗುತ್ತದೆ.",
    ko: "준비가 된? 커서를 사용하여 대상이 나타날 때까지 크로스 헤어의 중심을 추적하십시오. 커서가있을 때 십자 머리카락이 대담 해집니다.",
    lt: "Paruošta? Norėdami sekti kryžiaus plaukų centrą, kol pasirodys taikinys, naudokite žymeklį. Kryžminiai plaukai tampa drąsūs, kai ant jo yra žymeklis.",
    ms: "Bersedia? Gunakan kursor untuk menjejaki pusat rambut salib sehingga sasaran muncul. Rambut salib menjadi berani apabila kursor berada di atasnya.",
    no: "Klar? Bruk markøren til å spore midten av krysshåret til målet vises. Korshåret blir dristig når markøren er på det.",
    fa: "آماده؟ برای ردیابی مرکز موهای متقاطع تا زمانی که هدف ظاهر شود ، از مکان نما استفاده کنید. وقتی مکان نما روی آن قرار دارد موهای متقاطع جسورانه می شوند.",
    pl: "Gotowy? Użyj kursora, aby śledzić środek włosów krzyżowych, aż pojawi się cel. Krzyżowe włosy stają się odważne, gdy jest na nim kursor.",
    pt: "Preparar? Use o cursor para rastrear o centro do cabelo cruzado até que o alvo apareça. O cabelo cruzado fica ousado quando o cursor está nele.",
    ro: "Gata? Folosiți cursorul pentru a urmări centrul părului încrucișat până când apare ținta. Părul încrucișat devine îndrăzneț atunci când cursorul este pe el.",
    ru: "Готовый? Используйте курсор, чтобы отслеживать центр кросс -волос, пока не появится цель. Крестные волосы становятся смелыми, когда курсор на нем.",
    sr: "Спремни? Употријебите курсор да бисте пратили средину крстове косе док се не појави циљ. Укрштена коса постаје смела када је курсор на њему.",
